import styles from "../styles/Header.module.css";

function Header() {
  return (
    <div>
      <nav className="navBar">
        <div className="navLogo">
          <i class="fa-solid fa-phone fa-2x"></i>
          <i class="fa-brands fa-facebook fa-2x"></i>
        </div>
      </nav>
    </div>
  );
}

export default Header;
